    false,nt"url": null,nt"notes": "Observational reports of daily snow fall
    (1200 UTC to 1200 UTC) are made by members of the NWS Automated Surface Observing
    Systems (ASOS) network and NWS Cooperative Observer Network (COOP). Reports from
    approximately 2,000 stations across the US including Alaska and Hawaii are sent
    on a daily basis to the Climate Prediction Center (CPC).CPC processes these reports
    once per day. All reports for the same day are put into an ASCII text file whose
    name includes the date of observation. These data are used by CPC in its role of
    supporting the Joint Agricultural Weather Facility (JAWF).",nt"license_title":
